import{_ as t,o as e,c as s,b as o}from"./chunks/framework.6c3c27db.js";const r="/assets/IMG_7985.d0dd32c2.jpg",a="/assets/IMG_7986.e022d7af.jpg",p="/assets/IMG_7988.8993cc85.jpg",c="/assets/IMG_7989.5a0ac1f7.jpg",q=JSON.parse('{"title":"Двор Сотрудней переезжает","description":"","frontmatter":{"title":"Двор Сотрудней переезжает","date":"2015-01-02","cover":"IMG_7956.jpg"},"headers":[],"relativePath":"practice/process/dvor-sotrudnej-pereehal/index.md","filePath":"practice/process/dvor-sotrudnej-pereehal/index.md"}'),_={name:"practice/process/dvor-sotrudnej-pereehal/index.md"},d=o('<p>Новый год — отличный повод для перемен. <a href="/workshop/tour/dvor-sotrudnej/" title="Двор сотрудней">Общественная мастерская &quot;Двор Сотрудней&quot;</a> показывает пример и переезжает из уютного, но тесноватого подвала на Чистых Прудах. 30 декабря команда мастерской и волонтёры OOLEY вынесли и вывезли тонны накопившихся материалов, инструментов, книг, мебели и уже приступили к работе над воссозданием мастерской в новом месте.</p><p>Главная причина переезда — то, что Двору Сотрудней стало уже слишком тесно в небольшом подвале в центре города и настало время расширения. Новое место хоть находится и не в самом центре Москвы, но расположено удобно и доступно: всего в двух минутах ходьбы от метро Преображенская площадь на территории Научно-исследовательского института дальней радиосвязи, короче НИИДАР. Основная часть института перебазируется в Зеленоград и освобождающиеся помещения постепенно заполняются новыми компаниями.</p><p><img src="'+r+'" alt=""><img src="'+a+'" alt=""><img src="'+p+'" alt=""><img src="'+c+'" alt=""></p><p>Один из огромных освободившихся цехов и выбрал &quot;Двор Сотрудней&quot; для своего расширения. Длиной почти 30 метров, с шестиметровыми потолками и трехтонным краном-балкой этот цех сможет вместить смелые идеи и позволит серьезно расширить возможности мастерской. &quot;Двор&quot; даже готовит некоторый ребрендинг в связи с этим, но об этом мы расскажем позже.</p><p>Формат общественной мастерской будет расширяться: планируется не только большая общая зона для работы с почасовой и абонементной оплатой, но и около восьми обособленных комнат для работы самостоятельных мастеров. Большие станки и сложное оборудование разместится в отдельной зоне. Основные работы по оборудованию мастерской планируется завершить уже к концу праздников и, будем надеяться, обновленный &quot;Двор Сотрудней&quot; отроет свои двери уже в середине января.</p><p>OOLEY постарается принять активное участие в обустройстве и налаживании работы обновленного Двора Сотрудней, помогая сделать эту мастерскую открытой, понятной и доступной каждому, но в то же время предоставляющей как можно больше возможностей не только для начинающих, но и для продвинутых мастеров. Мы будем держать вас в курсе событий, накапливать и делиться опытом создания открытых мастерских и примем и передадим любые советы, пожелания и предложения. Пишите!</p>',6),i=[d];function n(l,u,m,f,h,g){return e(),s("div",null,i)}const v=t(_,[["render",n]]);export{q as __pageData,v as default};
